    /* Soft mask to hide the top-right logo without changing the background */
    .logo-mask {
      position: absolute;
      top: 0;
      right: 0;
      width: 22vw;      /* adjust if needed */
      height: 16vh;     /* adjust if needed */
      pointer-events: none;
      /* A subtle gradient that fades into the background to cover the logo */
      background: radial-gradient(80% 80% at 90% 10%,
                  rgba(10, 2, 34, 0.95) 0%,
                  rgba(15, 3, 50, 0.88) 40%,
                  rgba(20, 5, 60, 0.65) 70%,
                  rgba(20, 5, 60, 0.0) 100%);
      filter: blur(2px);
    }

    .bubble {
      position: absolute;
      border-radius: 50%;
      background: radial-gradient(circle at 30% 30%, var(--bubbleInner), var(--bubbleOuter));
      opacity: 0.75;
      animation: floatUp var(--floatDur) linear infinite, pop var(--popDur) ease-in-out 1.5s infinite;
      will-change: transform, opacity;
    }

    @keyframes floatUp {
      0%   { transform: translateY(0) scale(1); }
      100% { transform: translateY(-120vh) scale(1); }
    }

    @keyframes pop {
      0%, 100% { transform: scale(0.85); opacity: 0.65; }
      50%       { transform: scale(1.25); opacity: 1; }
    }
  </style>
</head>
<body>
  <div class="logo-mask"></div>

  <script>
    // Create bubbles with pop-in/out + upward float
    const numBubbles = 65;
    const make = () => {
      const b = document.createElement('div');
      b.className = 'bubble';
      const size = Math.random() * 42 + 18; // 18px–60px
      b.style.width  = size + 'px';
      b.style.height = size + 'px';
      b.style.left   = (Math.random() * 100) + 'vw';
      b.style.top    = (Math.random() * 100) + 'vh';
      // Randomize durations
      const floatDur = (Math.random() * 8 + 8).toFixed(2) + 's';
      const popDur   = (Math.random() * 2 + 2).toFixed(2) + 's';
      b.style.setProperty('--floatDur', floatDur);
      b.style.setProperty('--popDur',   popDur);
      // Staggered start
      b.style.animationDelay = (Math.random() * 5).toFixed(2) + 's, ' + (Math.random() * 2).toFixed(2) + 's';
      document.body.appendChild(b);
      // Recycle bubble when it leaves the screen (for seamless loop)
      const reset = () => {
        b.style.top = '110vh';
        b.style.left = (Math.random() * 100) + 'vw';
      };
      b.addEventListener('animationiteration', (e) => {
        if (e.animationName === 'floatUp') reset();
      });
    };

    for (let i = 0; i < numBubbles; i++) make();
  </script>
</body>
</html>
